INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(1, 'Остров фантазий', 'Загадочный мистер Рорк воплощает в жизнь самые смелые и тайные мечты своих постояльцев на роскошном труднодоступном тропическом курорте. Но будут ли готовы гости разгадать тайну острова и спасти свои жизни, когда их фантазии обернутся кошмаром?', , 1, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(2, 'Пустой человек', 'В поисках пропавшей девушки бывший полицейский выходит на след тайной группы, члены которой одержимы идеей призвать в наш мир некую сверхъестественную сущность.', , 1, 1),
(3, 'Правосудие Спенсера', 'Правосудие Спенсера — американский комедийный боевик режиссёра Питера Берга по сценарию Шона О’Кифи и Брайана Хелгеленда, написанного по мотивам романа Эйса Аткинса «Страна чудес» с персонажами, созданными Робертом Б. Паркером.', , 3, 1);
INSERT INTO `news` (`id`, `title`, `text`, `picture`, `category_id`, `user_id`) VALUES
(4, 'Призрачная шестёрка', 'Инсценировав собственную смерть, сознательный миллиардер начинает новую жизнь — набирает отряд наёмников из разных стран, чтобы бороться со злом в этом мире. Все члены команды получают вместо имён цифры, и их целью становится свержение диктатора и освобождение народа страны Тургистан.', , 2, 1);

